import React from 'react'
import { Switch, Route } from 'react-router-dom';
import HistoryDevice from '../components/Users/HistoryDevice';
import Users from '../components/Users/Users'
export default function UserRouter() {
    return (
        <div>
            <Switch>
                <Route path='/userdashboard/deviceshistory' component={HistoryDevice} />
            </Switch>
        </div>
    )
}
